pub const GameTextInputImeOptions_IME_FLAG_NO_FULLSCREEN: GameTextInputImeOptions = 33554432;
#[doc = " Flag of {@link #imeOptions}: like {@link #IME_FLAG_NAVIGATE_NEXT}, but\n specifies there is something interesting that a backward navigation\n can focus on.  If the user selects the IME's facility to backward\n navigate, this will show up in the application as an {@link #IME_ACTION_PREVIOUS}\n at {@link InputConnection#performEditorAction(int)\n InputConnection.performEditorAction(int)}."]
